const jsonOriginal = msg.payload;

const nuevoJson = {};

for (const port in jsonOriginal) {
  if (jsonOriginal.hasOwnProperty(port)) {
    const data = jsonOriginal[port].data;
    const serial = jsonOriginal[port].serial;

    if (serial) {
      nuevoJson.data = {
        ...nuevoJson.data,
        [serial]: { ...data }
      };
    }
  }
}

msg.payload = nuevoJson;
return msg;

const iolink = global.get("iolink")
const resultado = {};
if(!!iolink) {
    if (!!msg.payload.data) {
        const keys = Object.keys(iolink);

        for(const _key of keys) {
            const serial = iolink[_key]["devSerial"]
            if(!!serial) {
                const distance = msg.payload.data[serial].distance
                if(!!distance) {
                    resultado[_key] = distance
                } else {
                    resultado[_key] = 0
                }
            } else {
                resultado[_key] = 0
            }

        }

    }
}

return resultado;

msg.topic = `
  DELETE FROM DATA;
`;

return msg;
